return(
    <div>
        <h1>{title}</h1>
        <p>
            <span>{desc1}</span>
            <span>{desc2}</span>
        </p>
{formtype==="singup"?(<SignUpForm/>):(<LoginForm/>)
}

<div></div>
<p>oR</p>
<div></div>
<button>Sign Up with Google</button>


<div>
 <img src={frameImage} alt="pattern" width={558} height={504} loading="lazy"/>  

 <img src={image} alt="pattern" width={558} height={490} loading="lazy"/>    
</div>

    </div>
);
}
